✈️  Corpo de resgate de aeronaves 

A segurança de voo é uma questão de suma importância, por isso os cientistas estão tentando inventar novos sistemas de segurança que tornem o voo confortável e seguro. Recentemente, engenheiros desenvolveram um sistema que, quando uma aeronave cai, desconecta o compartimento com passageiros e garante um pouso suave em qualquer superfície.
